import {  Navbar, Nav,NavDropdown ,Form,FormControl,Button} from 'react-bootstrap'
import { useHistory } from "react-router-dom";
import React, { useState } from 'react';
export let SetUser
let history = null
const Navigator = () => {
  let History = useHistory()
    history= History
    // ...
    const [user, setUser] = useState({name:"guest",isLog:false});
    
    SetUser=setUser
    let dropDown=null;
    let navBarHome = null;
    function logOut(){
      setUser({name:"guest",isLog:false})
      History.replace("/LogIn") 
       
    }
    if (!user.isLog){
   
    }else{
      dropDown=<NavDropdown title={user.name} id="basic-nav-dropdown">
         <NavDropdown.Item onClick={logOut}>Logout</NavDropdown.Item>
        <NavDropdown.Divider />
      </NavDropdown> 
      navBarHome = <Navbar.Brand onClick={()=>{History.replace("/Home")}}>ToDo</Navbar.Brand>
    }
     
    return (
  <Navbar bg="light" expand="lg">
  {navBarHome}
  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav">
  {dropDown}
  </Navbar.Collapse>
</Navbar>
    )}
export default Navigator
